import React from 'react';


const TodoItem = (props) => {
    return (
        <div className = "todo-item" disabled={props.item.completed}>
            <input type = "checkbox" checked={props.item.completed} />
            <p>{props.item.text}</p>
        </div>
    )
}

export default TodoItem;
